css:
@-moz-document 
  domain(wiby.me),
  domain(wiby.org) {
    body {
        background: #011919;
        color: #B9AA9B
    }
    pre {
        color: #CCCCCC
    }
    .url {
        color: #A02CC7;
    }
    p.titlep, a.tiny, a:link, font[color="#7900A7"], .pin {
        color: #CCCCCC
    }
    input[type="text"], input[type="submit"] {
        border-radius: 10px;
        border: 1px solid #4D5454;
        background: #373D3D;
        padding: 5px;
        color: #CCCCCC;
    }
    p.titlep {
        background: url(https://i.pinimg.com/originals/62/08/9e/62089ee9672198cd380b938aec5f1577.gif) no-repeat center bottom;
        background-size: 200px;
        padding-bottom: 140px;
    }
  }
